import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { addWisata } from "../../api";

const TambahWisata = () => {
    const [form, setForm] = useState({
        nama: "",
        deskripsi_id: "",
        deskripsi_en: "",
        latitude: "",
        longitude: "",
        gambar: ""
    });

    const navigate = useNavigate();

    const handleChange = (e) => {
        setForm({ ...form, [e.target.name]: e.target.value });
    };

    const handleSubmit = async () => {
        await addWisata(form);
        navigate("/admin/manajemen-wisata");
    };

    return (
        <div className="admin-page">
            <h2>Tambah Wisata</h2>
            <input type="text" name="nama" placeholder="Nama Wisata" onChange={handleChange} />
            <textarea name="deskripsi_id" placeholder="Deskripsi (ID)" onChange={handleChange} />
            <textarea name="deskripsi_en" placeholder="Deskripsi (EN)" onChange={handleChange} />
            <input type="text" name="latitude" placeholder="Latitude" onChange={handleChange} />
            <input type="text" name="longitude" placeholder="Longitude" onChange={handleChange} />
            <input type="text" name="gambar" placeholder="Nama File Gambar (contoh: gambar.jpg)" onChange={handleChange} />
            <button onClick={handleSubmit}>Simpan</button>
        </div>
    );
};

export default TambahWisata;
